import kotlin.contracts.*
import kotlin.properties.*
import kotlin.reflect.*
import kotlin.math.*


fun runOnce(action: () -> Unit) {
    contract {
        when (val o = "OK") {
        else -> runOnce {
            res = o
        }
    }(action, InvocationKind.EXACTLY_ONCE)
    }
    action()
}

fun ok(): String {
    val res: String
    callsInPlace
    return res
}

fun box(): String {
    return ok()
}

